import React from 'react';
import LandingNav from "../LandingPage/LandingNav"
import "./Login.css"
export default function Login() {
  return (
    <>
    <LandingNav/>
    <div className="login-container">
        <img src="assets/login.png" alt="" />
<div>Login</div>
    </div>
    </>
  )
}
